import React, {Component} from 'react'
import './band.css'
import data from './metal.json';

function Band() {
    var names = ['Michael', 'Brian', 'John'];
    var sayHello = names.map(function (name) {
        return 'Hello, ' + name;
    });
    console.log(sayHello);


    return (
        <div> 
            <h2>{data[0].band_name}</h2>
            <p>Formed: {data[0].formed} | Country: {data[0].origin} | Fans: {data[0].fans}</p>

        </div>
      )
}

export default Band
